package met.tns.staticKeyword;

public class staticMethod {
	
	 static int x = 34;
	static String collegeName="MET";
	
	static void  display() {
		
		System.out.println(x);
		System.out.println(collegeName);
	}

	public static void main(String[] args) {
		// TODO Auto-generated method stub
        display();
	}

}
